import React from 'react'
import { Button, Col, Row } from 'antd';
import More from '../../assets/img/iconos/more_vert-24px.svg'

export default function Sucursales(props) {
    const {sucursales} = props;

    //console.log(props);
    return (   
        props.map(sucursal => (
           <>
            <h1>{sucursal.name}</h1>
          </>
          
         ))

        
            
    )
}
